import React from 'react';
import styled from 'styled-components';
import { useMoodboard } from '../context/MoodboardContext';
import { stickers, categories } from '../utils/stickersData';
import { Undo2, Redo2, Trash2 } from 'lucide-react'; // Optional icons from lucide-react

const SidebarContainer = styled.div`
  display: flex;
  flex-direction: column;
  height: 100%;
  width: 260px;
  background-color: var(--bg-primary);
  border-right: 1px solid var(--border-color);
  overflow: hidden;
`;

const ScrollableContent = styled.div`
  flex: 1;
  overflow-y: auto;
  padding: 16px 12px;
  scrollbar-width: thin;
  scrollbar-color: var(--scroll-thumb) transparent;

  &::-webkit-scrollbar {
    width: 6px;
  }
  &::-webkit-scrollbar-thumb {
    background-color: var(--scroll-thumb);
    border-radius: 10px;
  }
`;

const CategorySection = styled.div`
  margin-bottom: 24px;
`;

const CategoryTitle = styled.div`
  font-size: 0.85rem;
  font-weight: 600;
  color: var(--text-secondary);
  margin-bottom: 10px;
  display: flex;
  align-items: center;
  gap: 8px;
  padding-left: 6px;
`;

const StickersGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fill, minmax(80px, 1fr));
  gap: 10px;
`;

const StickerItem = styled.div`
  background: var(--sticker-bg);
  border-radius: 10px;
  padding: 10px;
  aspect-ratio: 1 / 1;
  box-shadow: 0 2px 6px var(--shadow-color);
  transition: all 0.2s ease-in-out;
  cursor: grab;
  display: flex;
  align-items: center;
  justify-content: center;

  &:hover {
    transform: translateY(-4px) scale(1.03);
    box-shadow: 0 6px 12px var(--shadow-color);
  }

  img {
    width: 100%;
    height: 100%;
    object-fit: contain;
  }
`;

const ActionsContainer = styled.div`
  padding: 16px;
  border-top: 1px solid var(--border-color);
  background-color: var(--bg-secondary);
  display: flex;
  flex-direction: column;
  gap: 8px;
`;

const ActionButton = styled.button`
  display: flex;
  align-items: center;
  gap: 8px;
  font-weight: 500;
  font-size: 0.85rem;
  padding: 10px 12px;
  border: none;
  border-radius: 8px;
  background: var(--btn-bg);
  color: var(--text-primary);
  cursor: pointer;
  transition: all 0.2s ease-in-out;

  &:hover {
    background: var(--btn-hover-bg);
  }

  &:disabled {
    opacity: 0.5;
    cursor: not-allowed;
  }

  svg {
    width: 16px;
    height: 16px;
  }
`;

const Sidebar: React.FC = () => {
  const { state, dispatch } = useMoodboard();

  const handleDragStart = (e: React.DragEvent, sticker: any) => {
    e.dataTransfer.setData('application/json', JSON.stringify(sticker));
  };

  const handleDeleteSelected = () => {
    if (state.selectedSticker) {
      dispatch({ type: 'DELETE_STICKER', payload: state.selectedSticker });
    }
  };

  const handleUndo = () => {
    dispatch({ type: 'UNDO' });
  };

  const handleRedo = () => {
    dispatch({ type: 'REDO' });
  };

  return (
    <SidebarContainer>
      <ScrollableContent>
        {categories.map((category) => (
          <CategorySection key={category.id}>
            <CategoryTitle>
              <span>{category.icon}</span>
              {category.name}
            </CategoryTitle>
            <StickersGrid>
              {stickers
                .filter((sticker) => sticker.category === category.id)
                .map((sticker) => (
                  <StickerItem
                    key={sticker.id}
                    draggable
                    onDragStart={(e) => handleDragStart(e, sticker)}
                  >
                    <img src={sticker.image} alt={sticker.name} />
                  </StickerItem>
                ))}
            </StickersGrid>
          </CategorySection>
        ))}
      </ScrollableContent>
      <ActionsContainer>
        <ActionButton onClick={handleUndo} disabled={state.historyIndex === 0}>
          <Undo2 /> Undo
        </ActionButton>
        <ActionButton
          onClick={handleRedo}
          disabled={state.historyIndex === state.history.length - 1}
        >
          <Redo2 /> Redo
        </ActionButton>
        <ActionButton
          onClick={handleDeleteSelected}
          disabled={!state.selectedSticker}
        >
          <Trash2 /> Delete Selected
        </ActionButton>
      </ActionsContainer>
    </SidebarContainer>
  );
};

export default Sidebar;
